import { Typography } from '@mui/material'
import React, { useState } from 'react'
import { useEffect } from 'react'

function ApiTest() {
   const [data,setData]= useState('')

   useEffect(()=>{fetch('https://tomestry.com/api/merchandise/').then((res)=>{return res.json()}).then((res)=>{return setData(res)})})


  return (
    <div>{data.map((el)=>{ <Typography>{el}</Typography>})}</div>
  )
}

export default ApiTest
